/*
    Getter Functions
*/

    function fetchAllBid() public returns (order[] memory) {
        // return sortedBidBook;
    }

    // function fetchAllAsk() public returns (order[] memory) {
    //     // sortAsk(askBook);
    //     return askBook;
    // }

    function fetchYourBidIds() public returns (uint256[] memory) {
        // for (uint256 i = 0; i < bidBook.length; i++) {
        //     if (bidBook[i].customer == msg.sender) {
        //         request.push(i);
        //     }
        // }
        // return request;
    }

    function fetchYourAskIds() public returns (uint256[] memory) {
        // for (uint256 i = 0; i < askBook.length; i++) {
